import React from 'react';

const HomePage = () => {

    const [list,setList] = useState([]);

    useEffect(() => {
        axios.get('http://localhost:3001/api/get').then((response) => {
            setList(response.data);
            // console.log(response.data);
            // alert(response);
        });
    }, []);
    
    return(
        <div className="container">
            <div className=" py-4 ">
                <h1 >Home Page</h1>
            </div>
        </div>
    )
}

export default HomePage;
